        <ion-col >
          <ion-button (click)="gotopatientpage(patient)" color="primary"><ion-icon name="folder-sharp"></ion-icon></ion-button>
        </ion-col>
        <ion-col >{{ patient.nom }}</ion-col>
        <ion-col >{{ patient.prenom }}</ion-col>
        <ion-col >{{ patient.age }}</ion-col>
